import img1 from "../assets/DuocUCLogo.png";
import img2 from "../assets/OfCourseAmarillo.png";

export default function AuthLogo() {
  return (
    <section className="bg-duocazul py-16">
      <div className="relative max-w-2xl mx-auto">
        {/* Imágenes sobre el div (una encima de la otra) */}
        <div className="absolute inset-x-0 -top-10 z-10 flex flex-col items-center gap-2 pointer-events-none">
          <img
            src={img1}
            alt="Imagen superior"
            className=" h-24 "
          />
          <img
            src={img2}
            alt="Imagen inferior"
            className="w-16 h-16 object-cover rounded-full ring-4 ring-white shadow-md"
          />
        </div>

        {/* Tu div/tarjeta debajo */}
        <div className="bg-white rounded-xl shadow p-6 mt-20">
          <h2 className="text-xl font-bold mb-2">Contenido del bloque</h2>
          <p className="text-gray-700">
            Aquí va tu contenido. Las imágenes quedan flotando arriba sobre el
            fondo duocazul.
          </p>
        </div>
      </div>
    </section>
  );
}
